window.bookSummaryJSON = "<p>Deep below the Pacific, the crew of the <i>Thales</i> attempt to harness the power of deep ocean currents. Using turbines, they could harness more renewable energy than the world has ever seen. However, when a pressure valve ruptures they struggle for survival, and discover one of their own may have wanted the station to fail all along. With an entire ocean threatening their lives, they understand to live, they have to harness the ocean, and power the world.</p>"; 
